  });

  BookingHistoryPayLoad copyWith({
    String? userId,
  }) =>
      BookingHistoryPayLoad(
        userId: userId ?? this.userId,
      );

  factory BookingHistoryPayLoad.fromJson(String str) => BookingHistoryPayLoad.fromMap(json.decode(str));

  String toJson() => json.encode(toMap());

  factory BookingHistoryPayLoad.fromMap(Map<String, dynamic> json) => BookingHistoryPayLoad(
        userId: json["user_id"],
      );

  Map<String, dynamic> toMap() => {
        "user_id": userId,
      };
}

